                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="barrio_destino">Barrio<span className="text-danger">*</span></label>
                                <Field value={barrio} as="input" type="text" autoComplete="off" className="form-control" 
                                id="barrio_destino" name="barrio_destino" 
                                onChange={event => handleInputChange(event, 19)}></Field>
                            </div>
                        </div>

