                                id="entidad_origen" name="entidad_origen"></Field>
                            </div>
                        </div>
                    
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 21)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="entidad_destino">Nombre Entidad</label>
                                <Field value={nombreEntidad} as="input" type="text" autoComplete="off" className="form-control" 
                                id="entidad_destino" name="entidad_destino" 
                                onChange={event => handleInputChange(event, 21)}></Field>
                            </div>
                        </div>

                        {/* 22. SECTOR ENTIDAD*/}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="sector_origen">Sector Entidad</label>
                                <Field value={item.attributes.sectorEntidad} as="input" type="text" autoComplete="off" className="form-control" 
                                id="sector_origen" name="sector_origen"></Field>
                            </div>
                        </div>
                    
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 22)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="sector_destino">Sector Entidad</label>
                                <Field value={sectorEntidad} as="input" type="text" autoComplete="off" className="form-control" 
                                id="sector_destino" name="sector_destino" 
                                onChange={event => handleInputChange(event, 22)}></Field>
                            </div>
                        </div>

                        {/* 23. TIPO INTERESADO*/}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="tipo_interesado_origen">Tipo Interesado</label>
                                <Field value={item.attributes.tipoInteresado} as="input" type="text" autoComplete="off" className="form-control" 
                                id="tipo_interesado_origen" name="tipo_interesado_origen"></Field>
                            </div>
                        </div>
                    
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 23)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="tipo_interesado_destino">Tipo Interesado<span className="text-danger">*</span></label>
                                <Field value={tipoInteresado} as="input" type="text" autoComplete="off" className="form-control" 
                                id="tipo_interesado_destino" name="tipo_interesado_destino" 
                                onChange={event => handleInputChange(event, 23)}></Field>
                            </div>
                        </div>


                        

                     

                        </>
                    )
                })
            )
        }
    }

    const enviarDatos = (datos) => {
        window.showSpinner(true);
        let data;

        /*data = {
            "data": {
                "type": 'antecedente',
                "attributes": {
                    "antecedentes": 3,
                    "descripcion": datos.descripcion,
                    "id_proceso_disciplinario": procesoDisciplinarioId,
                    "fecha_registro": Date.now(),
                    "id_dependencia": dependencia ? dependencia : "",
                }
            }
        }

        GenericApi.addGeneric("antecedentes",data).then(
            datos => {
                if (!datos.error) {
                    setModalState({ title: "SINPROC No "+radicado+" :: Crear Antecedente", message: 'Registro Exitoso', show: true, redirect: '/AntecedentesLista', from: {from}, alert: global.Constants.TIPO_ALERTA.EXITO});
                }
                else {
                    setModalState({ title: "SINPROC No "+radicado+" :: Crear Antecedente", message: datos.error.toString(), show: true, redirect: '/AntecedentesLista', from: {from}, alert: global.Constants.TIPO_ALERTA.ERROR });
                }
                window.showSpinner(false);

            }
        )*/
    }

    return (
        <>
            {<Spinner />}   
            {<ModalGen data={getModalState} />}
          
            <Formik
                initialValues={{
                    antecedente_origen: '',
                    antecedente_destino: '',
                    fecha_antecedente_origen: '',
                    fecha_antecedente_destino: '',
                }}
                enableReinitialize
                validate={(valores) => {
                    let errores = {}

                    return errores
                }}
                onSubmit={(valores, { resetForm }) => {
                    enviarDatos(valores);
                }}
            >

                {({ errors }) => (
                    <Form>

                    <div className="w2d_block">
                        <nav aria-label="breadcrumb">
                        <ol className="breadcrumb breadcrumb-alt push">
                            <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Buscador`}><small>Buscador</small></Link></li>
                            <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`}><small>Inicio proceso de migracin</small></Link></li>
                            <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ListarMigracionInteresados/${radicado}/${vigencia}`}><small>Lista de interesados</small></Link></li>
                            <li class="breadcrumb-item"> <small>Datos del interesado</small></li>
                        </ol>
                        </nav>
                    </div>

                      
                        <div className="block block-themed">
                            <div className="block-header">
                                <h3 className="block-title">Proceso disciplinario :: {radicado} - {vigencia} - Item No {item+1}</h3>
                            </div>

                            <div className="block-content">

                                <div className='text-right'>

                                    <Link to={`/AntecedentesLista/`} title='Regresar a lista de Antecedentes' >
                                        <button type="button" className="btn btn-success"><i className="fas fa-backward"></i> </button>
                                    </Link>
                                </div>

                                <div className="row">

                                    {infoInteresado()}
                                    
                                </div>

                            </div>
                            <div className="block-content block-content-full text-right bg-light">
                                <button type="submit" className="btn btn-rounded btn-primary">Registrar</button>

                                <Link to={`/AntecedentesLista/`}>
                                    <button type="button" className="btn btn-rounded btn-outline-primary">Cancelar</button>
                                </Link>
                            </div>
                        </div>
                    </Form>
                )}
            </Formik>
        </>
    );
}


